import Logo from './Logo'
import './Logo.css';
import Gold from './Gold'
import {Animated} from "react-animated-css"



const Home = () => {
  return (
  	<div className = "back">
    <Navigation />
    <div className="pt5">
    <div className="tc">

     <div  className = "title pb3 mb3 pa2 pa3-ns ml1 ml7-ns mr1 mr7-ns">
    <img  alt='robots' 
      src='./stt.png' width="600"/>

  </div>


  <div >
    <CardList main={main}/>
    </div>
    </div>
    </div>
    </div>
  );
    }


export default Home;
